import React from "react";
import { technologies } from "../../services/services";
import "./Blog.css"; // Ensure your custom styles are in this CSS file

// Define a functional component
export default function Blogs() {
  return (
    <div>
      <div className="container" style={{ paddingTop: "30px", backgroundColor: 'whitesmoke' }}>
        <div className="row">
          {/* Left column (col-1) */}
          <div className="col-12 col-md-4">
            <div className="sticky-top" style={{ top: "20px" }}>
              <u>
                <h2 className="blogHeader" style={{color:'#B87333'}}>We are Introducing Our Technologies</h2>
              </u>
              <p style={{ fontSize: "18px", fontFamily: "system-ui", marginTop: "20px",color:'black' }}>
                Explore the diverse technologies we utilize to create innovative and impactful solutions.
              </p>
              <div style={{ textAlign: 'center' }}>
  <ul style={{ listStyleType: 'none', padding: 0, margin: 0, textAlign: 'left' }}>
    <li style={{ color: 'black', display: 'flex', justifyContent: 'flex-start', alignItems: 'center' }}>
      <h1 style={{ marginRight: '10px', fontSize: '24px' }}>→</h1> 
      <span style={{ fontSize: '20px' }}>Digital Marketing</span>
    </li>
    <li style={{ color: 'black', display: 'flex', justifyContent: 'flex-start', alignItems: 'center' }}>
      <h1 style={{ marginRight: '10px', fontSize: '24px' }}>→</h1> 
      <span style={{ fontSize: '20px' }}>Html5 & Css3</span>
    </li>
    <li style={{ color: 'black', display: 'flex', justifyContent: 'flex-start', alignItems: 'center' }}>
      <h1 style={{ marginRight: '10px', fontSize: '24px' }}>→</h1> 
      <span style={{ fontSize: '20px' }}>Django</span>
    </li>
    <li style={{ color: 'black', display: 'flex', justifyContent: 'flex-start', alignItems: 'center' }}>
      <h1 style={{ marginRight: '10px', fontSize: '24px' }}>→</h1> 
      <span style={{ fontSize: '20px' }}>UI/UX Designer</span>
    </li>
    <li style={{ color: 'black', display: 'flex', justifyContent: 'flex-start', alignItems: 'center'}}>
      <h1 style={{ marginRight: '10px', fontSize: '24px' }}>→</h1> 
      <span style={{ fontSize: '20px' }}>ReactJS</span>
    </li>
  </ul>
</div>


            </div>
           
          </div>

          {/* Right column (col-2) */}
          <div className="col-12 col-md-8">
            <div className="row">
              {technologies.map((tech, index) => (
                <div key={index} className={`col-12 col-md-${index % 2 === 0 ? "6" : "6"} mb-4`}>
                  <div
                    className={`card box-shadow h-100 ${index % 2 === 0 ? "taller-card" : "smaller-card"}`}
                    style={{
                      borderRadius: "15px",
                    }}
                  >
                    {/* Image on top */}
                    <img
                      src={tech.imageUrl}
                      className="imgstyles img-fluid"
                      alt={tech.title}
                      style={{
                        width: "100%",
                        height: index % 2 === 0 ? "200px" : "150px",
                        objectFit: "cover",
                        borderRadius: "15px 15px 0 0",
                      }}
                    />

                    {/* Content below the image */}
                    <div className="card-body" style={{ textAlign: "center" }}>
                      <h4
                        style={{
                          fontSize: "24px",
                          fontFamily: "system-ui",
                          fontWeight: "bold",
                          color:'#B87333'
                        }}
                      >
                        {tech.title}
                      </h4>
                      <p style={{ fontFamily: "system-ui",color:'black' }}>
                        {tech.description}
                      </p>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
